import { Component } from '@angular/core';

@Component({
  selector: 'app-doxi-web',
  templateUrl: './doxi-web.component.html',
  styleUrls: ['./doxi-web.component.css']
})
export class DoxiWebComponent {
  linkRows: string[][] = [
    ['About Us', 'Press', 'Investors'],
    ['Blog', 'Work@', 'Contact'],
    ['Doximity App', 'Op-Med', 'Research'],
    ['Directory', 'Terms of Service', 'Privacy'],
    ['Partner Overview', 'Residency Navigator', 'Developer API'],
    ['Hiring Solutions', 'Hospital Solutions', 'Help']
  ];
}
<h1>doxi-web works!</h1>
